import { Box, Typography } from '@mui/material';
import React from 'react';

const HomePage: React.FC = () => {
    return (
        <>
            <Box
              sx={{
                height: '110px',
                textAlign: 'center',
                justifyContent: 'center',
                backgroundColor: 'black',
                filter: 'blur(20px)',
              }}
            >
              <Typography variant="h6" fontSize={"24px"} color='white'>
                Hey, intercept.
              </Typography>
            </Box>
            <Box>
                <p>Home page</p>
            </Box>
        </>
    );
}

export default HomePage;
